// Home.js

import React from 'react';
import Header from '../components/Header';

const Home = () => {
  return ( 
    <div>
      <Header />
      <div>
          <h1 className="text-white">All your movies and series, in one place.</h1>
      </div>
    </div>
  );
}

export default Home;
